package jumbo.euro.demoEuro.model.extern;


public class Note {
	
	private String	id;

	private String	estnot;

	private String	codnot;

	private String	txtinf;

	private String	codusu;

	private String	feccre;

	private String	rednot;

	
	public String getId() {
		return id;
	}

	
	public void setId(String id) {
		this.id = id;
	}

	
	public String getEstnot() {
		return estnot;
	}

	
	public void setEstnot(String estnot) {
		this.estnot = estnot;
	}

	
	public String getCodnot() {
		return codnot;
	}

	
	public void setCodnot(String codnot) {
		this.codnot = codnot;
	}

	
	public String getTxtinf() {
		return txtinf;
	}

	
	public void setTxtinf(String txtinf) {
		this.txtinf = txtinf;
	}

	
	public String getCodusu() {
		return codusu;
	}

	
	public void setCodusu(String codusu) {
		this.codusu = codusu;
	}

	
	public String getFeccre() {
		return feccre;
	}

	
	public void setFeccre(String feccre) {
		this.feccre = feccre;
	}

	
	public String getRednot() {
		return rednot;
	}

	
	public void setRednot(String rednot) {
		this.rednot = rednot;
	}
	
	
	

}
